import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses =
   [
   {title :'car insurance' ,
   amount: 294.67,
   date: new Date(2021,3,24)
   },
   {title :'car insurance' ,
   amount: 294.67,
   date: new Date(2021,3,26)
   },
   {title :'car insurance' ,
   amount: 294.67,
   date: new Date(2021,3,27)
   },
   {title :'car insurance' ,
   amount: 294.67,
   date: new Date(2021,3,29)
   }
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem>{expenses[0]}</ExpenseItem>
      <ExpenseItem>{expenses[1]}</ExpenseItem>
      <ExpenseItem>{expenses[2]}</ExpenseItem>
      <ExpenseItem>{expenses[3]}</ExpenseItem>





    </div>
  );
}

export default App;
